import logo from './logo.svg';
import './App.css';
import pic from './assets/yogi.jpg'

function App() {
  return (
    <div className='photo_card'>
      <img className="yogiPic" src={pic} alt ="yogendra pic" />
      <div>
        <div>Hello All. I AM</div>
        <div>YOG</div>
      </div>
    </div>
  );
}

export default App;
